}

#form, input {
    margin-top: 10px;
    margin-bottom: 15px;
    padding: 5px;
}

input {
    background-color:ivory;
    color:black;
    padding: 0.5rem;
}

button {
    padding: 3px;
    margin-bottom: 15px;
}

#saved-city-searches {
    display: flex;
    flex-direction: column;
    padding: 1rem;
    text-align: center;
    gap: 1.5rem;
}

#saved-city-searches >div {
    background-color: darkorange;
    padding: .5rem;
    user-select: none;
}

#saved-city-searches >div:hover {
    cursor:pointer;
    background-color: blanchedalmond;
}

#current-weather {
    display: flex;
    flex-direction: column;
    text-align: left;
    border: 2px solid black;
    padding: 0.5rem;
    gap: 0.5rem;
}

#currcity, #currdate, #curricon{
    font-size: 2rem;
    font-weight: bolder;
    margin: 3px;
}

